measurements.description:
Eighteen slightly starry flowers on one 107-cm staked, upright inflorescence, six buds on a juvenile inflorescence;
sepals and petals cream overlaid rose, darker rose veining, narrow white edges;
lip cream, midlobe boldly barred and marked bugundy, edged white, keels yellow marked burgundy, side lobes barred and marked burgundy;
column superior surface rose shading to dark rose distally, inferior surface barred burgundy, anther cap white;
 substance medium; texture matte.
